import Layout from './Layout';
import '../styles/home.css';
import foodImage from '../images/food.jpg';

const Home = () => {
  return (
    <Layout>
      <div className="home-container">
        <div className="hero-section">
          <h1>Welcome to Our Recipe App</h1>
          <p>Discover the best recipes from Kenyan cuisine and more!</p>
          <button className="cta-button">Explore Recipes</button>
        </div>
        <img src={foodImage} alt="Food" className="hero-image" />
        <footer className="footer">
          <p>&copy; 2024 Our Recipe App. All rights reserved.</p>
        </footer>
      </div>
    </Layout>
  );
};

export default Home;
